import React, { Component } from 'react';
import {InfoConsumer} from './Context';
class Info extends Component {
    render(){
    const info = this.props.value
    return (
        <InfoConsumer>
            {value => (
                <div className = "col-10 col-lg-1 mx-auto mb-5">
                    <div className="card" style={{width:'24rem'}}>
                        <img src={info.img} alt={info.headerTitle} className="card-img-top" />
                        <div className="card-body">
                            <h3 className="card-title text-uppercase">
                                {info.headerTitle}
                            </h3>
                            <h5 className="card-title">{info.headerSubtitle}</h5>
                        </div>
                    </div>
                </div>
            )}
        </InfoConsumer>
    )}
}
export default  Info;
